import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar(){
    return(
        <>
         <nav>
            <div>
                <ul id="navbar">
                    <li><a href="index.html">Home</a></li>
                    <li><a href="index.html">Edit Information</a></li>
                    <li><a href="index.html">Upload Requirements</a></li>
                    <li><a href="index.html">Endorsement Letter</a></li>
                </ul>
            </div>
        </nav>
        </>
    )
}

export default Navbar;
